At AustralianSuper, we truly care about our colleagues. We know work and life are intertwined. That's why we support the diverse needs of everyone and have policies that enable us all to thrive and be truly flexible. We ensure diversity is celebrated for the opportunity it provides us all to learn and grow and deliver better outcomes for members. We are dedicated to building a high-performance environment underpinned by a strong risk culture, ensuring we deliver the best outcomes for our members.

Make a difference delivering outcomes for our millions of members
Manage & analyse ESG data into accurate and actionable insights
Contract role until September 20326, based in Melbourne or Sydney

Your New Role

Effective ESG integration and stewardship is essential to managing investment risk and opportunity, and to achieving long-term value creation in AustralianSuper's investment portfolio. ESG reporting and disclosure also plays a key part in meeting stakeholder expectations and regulatory reporting requirements, including Australian Sustainability Reporting Standards (ASRS) mandatory disclosure - in particular, AASB S2 Climate Related Financial Disclosures.

This role supports implementation of an ESG data vendor, the integration of ESG analysis and insights into the ESG & Stewardship program in private markets, and delivery of ESG regulatory reporting requirements. You will be managing, analysing and transforming ESG data on private markets (infrastructure, property, private equity, private credit investments) into accurate and actionable insights and reporting to drive investment decisions and stewardship actions.

This is a contract role until September 2026 and can be based in Melbourne or Sydney.

Key responsibilities include:

Supporting the onboarding of an ESG data vendor and implementing ESG data collection from private markets portfolio companies and unlisted external fund managers;
Supporting the ESG team with data consolidation, verification and quality control for ESG performance data across private markets investments portfolio;
Facilitating engagement sessions and preparing materials to communicate AustralianSuper's ESG data priorities and educating stakeholders on evolving Australian regulatory reporting requirements;
Developing dashboards to track and monitor ESG performance across the private market investments portfolio;
Working with the ESG team to deliver reporting initiatives, such as but not limited to portfolio carbon tracking analysis, work health safety data dashboards, and more;
Supporting the ESG team with Asset Ownership Plans and transaction due diligence, developing informative extracts and insights from data to drive and influence investment decisions and ownership actions;
Supporting engagement with private markets external managers, to promote best practices in ESG data and disclosures, promoting alignment with AustralianSuper's stewardship priorities.

What You'll Need

Demonstrable experience in responsible investment, ESG/sustainability/climate research or reporting, investment data and analytics, or other relevant practical experience;
Working knowledge of key ESG/sustainability reporting standards and frameworks - e.g. ASRS AASB S1/S2, GHG Protocols, ISSB, PCAF, ILPA, CDP, TCFD, TISFD, CSDDD;
Strong data and analytical skills - Proficiency in MS Excel, BI Tools (Tableau, Power BI), SQL; with Database management, Python, data visualisation skills highly desirable;
Good interpersonal, problem solving and communication skills;
Proactive, with strong attention to detail;
Prior experience with unlisted asset classes, and experience in ESG/EHS/WHS due diligence in deals and transactions both highly regarded but not essential;
Tertiary qualifications likely in Commerce, Sustainability/ESG, Statistics, Data Science or Strategy, or equivalent/associated field preferred.

Research shows that diverse individuals often hesitate when applying for roles if they don't meet every requirement. If you are interested in this role and possess some of the above attributes, we encourage you to apply and demonstrate your potential.

