About the Company
 
This organisation is a well-established Australian business with a strong national presence and an increasing focus on data-driven decision making. Ongoing investment in data platforms and reporting enables teams across finance and operations to make informed commercial and strategic decisions. 
 
About the Role 
 
We are seeking an experienced Business Intelligence (BI) Developer with strong technical capability across both the data warehouse mid-layer (DWH / middleware) and front-end reporting. This role sits within the Finance Division as part of the Reporting Team and is responsible for delivering end-to-end BI solutions from data modelling and transformation through to Power BI dashboards and reports. 
 
You will work closely with finance commercial and IT stakeholders to ensure data is well structured reliable and accessible while also developing clear high-quality dashboards that translate complex data into actionable insights. 
 
Key Responsibilities 

Design develop and support the BI and reporting application suite;
Build and maintain the data warehouse mid-layer including data models ETL logic and transformations;
Ensure data integrity quality and performance across DWH and reporting layers;
Develop and optimise Power BI datasets dashboards and reports based on business requirements;
Create and maintain business logic including testing deployment and publishing;
Work with SQL Server and data warehouse technologies to optimise large datasets;
Monitor and improve performance of ETL processes queries and Power BI models;
Troubleshoot data quality and reporting issues across the full BI stack;
Partner with business stakeholders to deliver meaningful and actionable insights; and
Ensure BI solutions align with data governance security and privacy standards;
Skills & Experience 

Minimum three years experience across the Microsoft BI stack including Power BI;
Strong hands-on experience with data warehouse design ETL processes and middleware layers;
Excellent SQL and database design knowledge including performance tuning;
Proven experience developing production-grade Power BI reports and dashboards;
Experience working directly with business stakeholders to translate requirements into solutions;
Exposure to Python MS Fabric Fivetran DBT Azure or Azure DevOps is advantageous; and
Strong communication skills and ability to work in an agile environment.
